package playing.nope;



public class Something {

	private String name;
	private int age;
	
	public Something() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	@Override
	public String toString() {
		return "Something [name=" + name + ", age=" + age + "]";
	}
	
	
	
	
	
	
}



